Logistics Local by Gurtam is a service specially designed for delivery, courier and distribution companies. The new app for order management is intended for use with Logistics web-application now available for Wialon Local users.

With Logistics Local Mobile on your smartphone, you get your interaction with the office up to a new level.

How do you get started? Just a create a driver in Wialon Local, add your phone number and a mobile key, assign the driver to a vehicle, launch the mobile app and authorize with the phone number! 
Use the app to automate delivery process with the advanced features:
- easily accessible list of orders with detailed information on each; 
- delivery progress evaluation in real-time;
- detailed map to view orders and estimated route; 
- push-notification on orders, routes, and delivery progress to be immediately alerted;
- option to generate routes using external navigational applications; 
- order progress statuses (confirmed/rejected), comments and photos for each order; 
- handy chat to notify operators on any events on the way; 
- delivery confirmation with customer digital signature with data on customer name, delivery time and date indicated on a photo;
- tracker software functionality embedded into the app;
- optimization for tablets to view orders in tables and on the map simultaneously.

We offer advanced courier assistant on every stage of delivery.

